import { Component, Input, OnInit } from '@angular/core';
import { FormControl, FormGroup, Validators } from '@angular/forms';
import { NgbActiveModal } from '@ng-bootstrap/ng-bootstrap';
import { PaymentService } from 'src/app/services/payment.service';
import { CreatePaymentDTO } from '../dto';

@Component({
  selector: 'app-settle-up',
  templateUrl: './settle-up.component.html',
  styleUrls: ['./settle-up.component.css'],
})
export class SettleUpComponent implements OnInit {
  @Input() payerId!: number;
  @Input() payerUsername!: string;
  @Input() recieverId!: number;
  @Input() recieverUsername!: string;
  @Input() initialAmount!: number;
  @Input() initialCurrency!: string;
  @Input() balanceId!: number;
  @Input() currencies!: string[];

  settleUpForm = new FormGroup({
    amount: new FormControl<number | null>(null, Validators.required),
    currency: new FormControl<string>('', Validators.required),
  });

  constructor(
    public activeModal: NgbActiveModal,
    private paymentService: PaymentService
  ) {}
  ngOnInit(): void {
    this.settleUpForm.get('amount')?.setValue(this.initialAmount);
    this.settleUpForm.get('currency')?.setValue(this.initialCurrency);
  }

  submitForm() {
    const formValue = this.settleUpForm.value;
    const dto: CreatePaymentDTO = {
      userId: this.payerId,
      amount: formValue.amount!,
      currency: formValue.currency!,
      balanceId: this.balanceId,
    };
    console.log(dto);

    // this.paymentService.settleUp(dto);
  }

  get amount() {
    return this.settleUpForm.get('amount');
  }
  get currency() {
    return this.settleUpForm.get('currency');
  }
}
<div class="modal-header">
  <h4 class="modal-title">Settle up</h4>
  <button
    type="button"
    class="btn-close"
    aria-label="Close"
    (click)="activeModal.dismiss('Cross click')"
  ></button>
</div>
<div class="modal-body">
  <div class="row mb-2">
    <div class="col d-flex justify-content-center">
      {{ payerUsername }}<span class="mx-2"></span
      ><i class="bi bi-arrow-right"></i><span class="mx-2"></span
      >{{ recieverUsername }}
    </div>
  </div>
  <div class="row">
    <form [formGroup]="settleUpForm" (ngSubmit)="submitForm()">
      <div class="row mb-2">
        <div class="col">
          <div class="form-group">
            <label for="amount">Amount</label>
            <input
              type="number"
              min="0"
              onkeypress="return event.charCode >= 48 && event.charCode <= 57"
              inputmode="numeric"
              class="form-control"
              placeholder="Spent amount"
              id="amount"
              name="amount"
              formControlName="amount"
            />
            <div
              *ngIf="amount?.invalid && (amount?.dirty || amount?.touched)"
              class="alert alert-danger"
            >
              <div *ngIf="amount?.errors?.['required']">
                Amount is required.
              </div>
            </div>
          </div>
        </div>
        <div class="col">
          <label for="currency">Currency</label>
          <select
            type="text"
            class="form-control"
            id="currency"
            name="currency"
            formControlName="currency"
            required
          >
            <option *ngFor="let currency of currencies" [value]="currency">
              {{ currency }}
            </option>
          </select>
          <div
            *ngIf="currency?.invalid && (currency?.dirty || currency?.touched)"
            class="alert alert-danger"
          >
            <div *ngIf="currency?.errors?.['required']">
              Currency is required.
            </div>
          </div>
        </div>
      </div>
    </form>
  </div>
</div>
<div class="modal-footer">
  <button
    type="button"
    class="btn btn-outline-dark"
    (click)="activeModal.close('Close click')"
  >
    Close
  </button>
  <button type="button" class="btn btn-success">Settle up</button>
</div>
